function initMap(e){var o=new google.maps.Map(document.getElementById("map"),{zoom:2,minZoom:2,center:{lat:0,lng:0},mapTypeControl:!1}),a=e.map(function(e,o){return new google.maps.Marker({position:e,title:"location name"})});new MarkerClusterer(o,a,{imagePath:"https://developers.google.com/maps/documentation/javascript/examples/markerclusterer/m"})}$(document).ready(function(){$.ajax({type:"GET",url:"/master/messages-map/coords",success:function(e){if(e.length>0){for(var o=[],a=0;a<e.length;a++)o.push({lat:parseFloat(e[a].user_location_lat),lng:parseFloat(e[a].user_location_lng)});initMap(o)}}})}),$(window).on("load",function(){});